import React from "react";
import "../Navigation/Navigation_2.scss";

class Navigation_2 extends React.Component {
  render() {
    return (
      <div>
<nav>
<ul>
  <li> <a href="http://">Overview</a></li>
  <li> <a href="http://">Account Info.</a></li>
  <li> <a href="http://">Orders</a></li>
  <li> <a href="http://">Refunds</a></li>
  <li> <a href="http://">Message Center</a></li>
  <li> <a href="http://">Track Orders</a></li>
  <li> <a href="http://">Statistics</a></li>
</ul>

</nav>



        </div>
    );
  }
}

export default Navigation_2;
